import React from 'react';
import { Box, Typography, Paper, Grid } from '@mui/material';
const stockInfo = {
    name: "TeraWulf",
    fundamentals: {
      description: "TeraWulf is a diversified company primarily focused on harnessing blockchain technology..."
    },
    technical: {
      description: "The current stock price sits at $4.59, showcasing an uplift of 121.74% compared to a month ago..."
    },
    alternativeData: {
      description: "Starting with job postings, TeraWulf has maintained stability with 0 open positions over the past few months..."
    },
    conclusion: {
      description: "Based on the extensive analysis provided, TeraWulf is recommended as a strong buy, but potential investors should keep an eye on the short-term price movements due to the high RSI levels."
    }
  };
  
const GenerateAiScore = ({ stockData }) => {
  return (
    <Box padding={3}>
      <Typography variant="h4" gutterBottom>
        {stockData.name} - AI Stock Analysis
      </Typography>

      <Grid container spacing={2}>
        {/* Fundamental Analysis */}
        <Grid item xs={12} md={6}>
          <Paper elevation={3} padding={2}>
            <Typography variant="h6" color="secondary">Fundamental Analysis</Typography>
            <Typography variant="body1">{stockData.fundamentals.description}</Typography>
          </Paper>
        </Grid>

        {/* Technical Analysis */}
        <Grid item xs={12} md={6}>
          <Paper elevation={3} padding={2}>
            <Typography variant="h6" color="secondary">Technical Analysis</Typography>
            <Typography variant="body1">{stockData.technical.description}</Typography>
          </Paper>
        </Grid>

        {/* Alternative Data Analysis */}
        <Grid item xs={12}>
          <Paper elevation={3} padding={2}>
            <Typography variant="h6" color="secondary">Alternative Data Analysis</Typography>
            <Typography variant="body1">{stockData.alternativeData.description}</Typography>
          </Paper>
        </Grid>

        {/* Conclusion and Recommendation */}
        <Grid item xs={12}>
          <Paper elevation={3} padding={2}>
            <Typography variant="h6" color="secondary">Conclusion and Recommendation</Typography>
            <Typography variant="body1">{stockData.conclusion.description}</Typography>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default GenerateAiScore;
